window.bookSummaryJSON = "<p>\"My life was complete. Happy, content, everything neat and perfect. Then it all changed. I was sold.\" </p> <p>Tess Snow has everything she ever wanted: one more semester before a career in property development, a loving boyfriend, and a future dazzling bright with possibility. </p> <p>For their two-year anniversary, Brax surprises Tess with a romantic trip to Mexico. Sandy beaches, delicious cocktails, and soul-connecting sex set the mood for a wonderful holiday. With a full heart, and looking forward to a passion filled week, Tess is on top of the world. </p> <p>But lusty paradise is shattered. </p> <p>Kidnapped. Drugged. Stolen. Tess is forced into a world full of darkness and terror. </p> <p>Captive and alone with no savior, no lover, no faith, no future, Tess evolves from terrified girl to fierce fighter. But no matter her strength, it can't save her from the horror of being sold. </p> <p>Can Brax find Tess before she's broken and ruined, or will Tess's new owner change her life forever? </p>"; 
